import React, { Component } from 'react'
import { connect } from 'react-redux'
import { Route, BrowserRouter } from "react-router-dom";
import Home from ''

const Routes = () =>  {
  return(
<>
        <Router>
        <BrowserRouter>
            <Route component = { Home }  path="/" exact />
        </BrowserRouter>
        </Router>
</>
  ); 
}


export default Routes
